const updateHistory = (history, expression, result) => {
  console.log(history, expression, result)
  if (history.length >= 0) {
    const l = history.filter((elem) => elem !== expression && elem !== result)
    console.log(l)
    return l
  }
  return []
}

export default updateHistory
